import React from 'react';
import Carousel from '../components/Carousel'

function Home() {



    return(
        <div >
            <div className='info'>
                <h1 className='top'>우리는 대학생<br/>
                    벤처기사단입니다.
                </h1>
                <p>UKOV는 Undergraduated Knights of Venture의 약자로,<br/>
                    소프트뱅크벤처스의 후원 아래 엄선된 스타트업의 일을 돕고 함께 성장해 나가는 대외활동입니다.</p>
            </div>

            <Carousel />
        </div>

    )
}



export default Home;
